Aulas on-line
Sistema Movimento Integrado
com 
Claudia de Souza

“O equilíbrio está no fluir com a natureza.”

	Sistema Movimento Integrado é uma visão do corpo que busca de forma dinâmica compreender a estrutura física, mental e emocional.
	Utilizando-se de um repertório próprio de combinações de movimentos, se propõe a ir além do treino físico, acessando uma consciência integrada entre corpo, mente, espírito, suas histórias e o ambiente em que está inserido. 
	Sistema Movimento Integrado agrega áreas de conhecimento complementares em torno do corpo e do movimento, ampliando o repertório de forma sensível para que a prática sempre se renove a partir da comunicação com o todo. Movimento como caminho do autoconhecimento.
	Esse Sistema tem especial atenção para a integração dessa prática ao cotidiano do aluno.

“Habitar o próprio corpo é um primeiro passo para a liberdade.”

Claudia de Souza 
Educadora do movimento, coreógrafa e terapeuta corporal.

	Com mais de 35 anos de atuação na área da dança, educação do movimento e formação de profissionais, tem uma abrangente experiência em técnicas de dança, educação somática, Pilates, Thai Yoga Massage, Yoga Restaurativa, meditação e Sistema Bodytalk.
	Vem estruturando o Sistema Movimento Integrado, como prática corporal, nos últimos 10 anos com base na experiência e vivência pessoal e também nas de seus alunos. Observando como esse trabalho afeta de forma positiva padrões de mobilidade, além de pensamentos e emoções. 
	Essa construção vem sendo experimentada em paralelo e atravessada, pelas experiências artísticas e de processos de criação em dança vivenciados por Claudia, o que amplia o olhar para questões sociais e dos meios nos quais estamos inseridos.
